import React, { useState, useEffect } from "react";

export default function AdminPreferences() {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    fetch("http://localhost:5000/api/users") // Make sure your backend returns an array
      .then((res) => res.json())
      .then((data) => {
        setUsers(Array.isArray(data) ? data : []); // Safely ensure an array
      })
      .catch((err) => console.error("Failed to fetch users", err));
  }, []);

  if (!users || users.length === 0) return <p>No users found</p>;

  return (
    <div style={{ padding: 20, marginLeft: "240px" }}>
      <h1>User Preferences</h1>
      <table border="1" cellPadding="8">
        <thead>
          <tr>
            <th>ID</th>
            <th>Username</th>
            <th>Email</th>
            <th>Preferences</th>
          </tr>
        </thead>
        <tbody>
          {users.map((user) => (
            <tr key={user.id}>
              <td>{user.id}</td>
              <td>{user.username}</td>
              <td>{user.email}</td>
              <td>{user.preferences || "None"}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
